export function formateDate(time){if(!time)return"";let date=new Date(time),year=date.getFullYear(),month=date.getMonth()+1;month=month>=10?month:"0"+month;let day=date.getDate();day=day>=10?day:"0"+day;let hour=date.getHours();hour=hour>=10?hour:"0"+hour;let minute=date.getMinutes();minute=minute>=10?minute:"0"+minute;let second=date.getSeconds(),result;return second=second>=10?second:"0"+second,year+"-"+month+"-"+day+" "+hour+": "+minute+": "+second}